import React from 'react';
import './Cards.css';
import CardItem from './CardItem';

function Cards() {
    return (
        <div className='cards'>
            <div className='cards__container'>
                <div className='cards__wrapper'>
                    <ul className='cards__items'>
                        <CardItem
                            text='Lorem Spum bla bla bla'
                            label='Trade'
                            path='/companies'
                        />
                    </ul>
                </div>
            </div>
        </div>
    );
}

export default Cards;
